import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './components/Home';
import Navbar from "./components/Navbar";
import Footer from "./components/Footer";
import Banner from "./components/Banner";

// Landing Page Component
const LandingPage = () => {
  return (
    <div className="min-h-screen bg-gradient-to-br from-lime-50 to-lime-100 flex flex-col items-center justify-center">
      <div className="text-center">
        <h1 className="text-6xl font-bold text-gray-800 mb-6">Welcome to Binsight</h1>
        <p className="text-xl text-gray-600 mb-8 max-w-2xl">
          Your smart waste classification assistant. Upload an image and let our AI help you identify and properly dispose of your waste.
        </p>
        <div className="flex gap-4 justify-center">
          <a 
            href="/home" 
            className="bg-lime-400 text-black px-8 py-3 rounded-xl font-semibold text-lg hover:bg-lime-500 transition-colors duration-200 shadow-lg"
          >
            Get Started
          </a>
          <a 
            href="/banner" 
            className="bg-white text-lime-400 border-2 border-lime-400 px-8 py-3 rounded-xl font-semibold text-lg hover:bg-lime-50 transition-colors duration-200 shadow-lg"
          >
            Learn More
          </a>
        </div>
      </div>
    </div>
  );
};

function App() {
  return (
    <Router>
      <div className='flex flex-col min-h-screen'>
        <Navbar/>
        <main className="flex-1">
          <Routes>
            <Route path="/" element={<LandingPage />} />
            <Route path="/home" element={<Home />} />
            <Route path="/banner" element={<Banner />} />
          </Routes>
        </main>
        <Footer/>
      </div>
    </Router>
  );
}

export default App;
